import React, { useRef, useState } from "react";
import { MapPinIcon, UserIcon } from "@heroicons/react/24/outline";
import { useEmergency } from "../context/EmergencyContext";

const EmergencyMap = () => {
  const { location, emergencyHistory, setLocation } = useEmergency();
  const mapRef = useRef(null);
  const [manualLat, setManualLat] = useState("");
  const [manualLng, setManualLng] = useState("");
  const [manualMode, setManualMode] = useState(false);
  const [error, setError] = useState("");

  // Try to get current location if not set
  React.useEffect(() => {
    if (!location && !manualMode && navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          setLocation({
            latitude: position.coords.latitude,
            longitude: position.coords.longitude,
            accuracy: position.coords.accuracy,
          });
        },
        (err) => {
          setError("Unable to get your location. Please enter it manually.");
        },
        { enableHighAccuracy: true }
      );
    }
  }, [location, manualMode, setLocation]);

  // Handle manual location set
  const handleManualSet = (e) => {
    e.preventDefault();
    const lat = parseFloat(manualLat);
    const lng = parseFloat(manualLng);
    if (isNaN(lat) || isNaN(lng)) {
      setError("Please enter valid latitude and longitude.");
      return;
    }
    setLocation({ latitude: lat, longitude: lng, accuracy: null });
    setManualMode(false);
    setError("");
  };

  return (
    <div
      ref={mapRef}
      className="relative h-full w-full bg-gray-200 rounded-lg overflow-hidden"
    >
      {/* Map Container */}
      <div className="absolute inset-0 flex items-center justify-center">
        <div className="text-center">
          <MapPinIcon className="h-12 w-12 text-red-500 mx-auto mb-4" />
          <p className="text-gray-500">Map Integration Coming Soon</p>
          {error && <p className="text-red-500 text-sm mt-2">{error}</p>}
        </div>
      </div>

      {/* Emergency Markers */}
      <div className="absolute inset-0 pointer-events-none">
        {emergencyHistory.map(
          (emergency, index) =>
            emergency.location && (
              <div
                key={index}
                className="emergency-marker absolute transform -translate-x-1/2 -translate-y-1/2"
                style={{
                  left: `${
                    ((emergency.location.longitude + 180) / 360) * 100
                  }%`,
                  top: `${((90 - emergency.location.latitude) / 180) * 100}%`,
                }}
              >
                <div className="relative">
                  <div className="absolute -inset-2 bg-red-500 rounded-full opacity-20 animate-ping" />
                  <div className="relative bg-red-500 text-white rounded-full p-2 shadow-lg">
                    <UserIcon className="h-4 w-4" />
                  </div>
                </div>
              </div>
            )
        )}
      </div>

      {/* Current Location Marker */}
      {location && (
        <div
          className="absolute transform -translate-x-1/2 -translate-y-1/2"
          style={{
            left: `${((location.longitude + 180) / 360) * 100}%`,
            top: `${((90 - location.latitude) / 180) * 100}%`,
          }}
        >
          <div className="relative">
            <div className="absolute -inset-2 bg-blue-500 rounded-full opacity-20 animate-ping" />
            <div className="relative bg-blue-500 text-white rounded-full p-2 shadow-lg">
              <MapPinIcon className="h-4 w-4" />
            </div>
          </div>
        </div>
      )}

      {/* Map Controls */}
      <div className="absolute bottom-4 right-4 flex flex-col space-y-2 items-end">
        <button
          className="bg-white p-2 rounded-full shadow-lg hover:bg-gray-100 transition-colors text-xs mb-2"
          onClick={() => setManualMode((m) => !m)}
        >
          {manualMode ? "Cancel Manual Location" : "Set Location Manually"}
        </button>
        {manualMode && (
          <form
            onSubmit={handleManualSet}
            className="bg-white p-4 rounded-lg shadow-lg flex flex-col space-y-2 w-56"
          >
            <label className="text-xs text-gray-700">Latitude</label>
            <input
              type="number"
              step="any"
              value={manualLat}
              onChange={(e) => setManualLat(e.target.value)}
              className="border rounded px-2 py-1 text-sm"
              required
            />
            <label className="text-xs text-gray-700">Longitude</label>
            <input
              type="number"
              step="any"
              value={manualLng}
              onChange={(e) => setManualLng(e.target.value)}
              className="border rounded px-2 py-1 text-sm"
              required
            />
            <button
              type="submit"
              className="bg-indigo-600 text-white rounded px-2 py-1 text-xs mt-2 hover:bg-indigo-700"
            >
              Set Location
            </button>
          </form>
        )}
      </div>
    </div>
  );
};

export default EmergencyMap;
